import React, { useState } from 'react';

function AgregarViaje() {
  const [pais, setPais] = useState('');
  const [anio, setAnio] = useState('');
  const [mes, setMes] = useState('');
  const [duracion, setDuracion] = useState('');
  const [costo, setCosto] = useState('');
  const [kmRecorrido, setKmRecorrido] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    const viaje = { pais, anio, mes, duracion, costo, kmRecorrido };
    try {
      const res = await fetch('http://localhost:3003/agregar-viaje', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(viaje),
      });
      if (res.ok) {
        alert('Viaje agregado exitosamente');
      } else {
        alert('Error al agregar viaje');
      }
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div>
      <h2>Agregar Viaje</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" placeholder="Pais" value={pais} onChange={(e) => setPais(e.target.value)} required />
        <input type="number" placeholder="Año" value={anio} onChange={(e) => setAnio(e.target.value)} required />
        <input type="number" placeholder="Mes" value={mes} onChange={(e) => setMes(e.target.value)} required />
        <input type="number" placeholder="Duración" value={duracion} onChange={(e) => setDuracion(e.target.value)} required />
        <input type="number" placeholder="Costo" value={costo} onChange={(e) => setCosto(e.target.value)} required />
        <input type="number" placeholder="Km Recorridos" value={kmRecorrido} onChange={(e) => setKmRecorrido(e.target.value)} required />
        <button type="submit">Agregar Viaje</button>
      </form>
    </div>
  );
}

export default AgregarViaje;
